Hey there, I was playing with this awesome expression library awhile! But I hit a bug that ended-up do me to debugging my app for a few hours. And noticed it was due to my expression which blocking my progress on my project currently. I also search for whether this is a known issue or not, but couldn't find much. Here is a minimal reproducible snippet:

```golang
package main

import (
	"fmt"
	"github.com/antonmedv/expr"
)

func main() {
	env := map[string]uint64{
		"foo":  3,
		"bar":  5,
	}

	code := `(foo / bar) < 0.5`

	program, err := expr.Compile(code, expr.Env(env))
	if err != nil {
		panic(err)
	}

	output, err := expr.Run(program, env)
	if err != nil {
		panic(err)
	}

	fmt.Println(output)
}
```

**Bug**

Given `foo` is `3` and `bar` is `5`, resulting `0` if we evaluate with `(foo / bar)` expression. But actually it should return `0.6` instead. So eventually my `(foo / bar) < 0.5` expression also return `false` instead of `true`. It's evaluating as _true_ because of `0 < 0.5` is "true".

I'm not so sure if it's correct by design, since `int/int` resulting `int` in Go. So that `expr` resulting `0` as expected. But from the end-user perspective, I was expecting it should have _floating-point_ value. (at least this is what most modern calculators' do, given 3/5 is just 0.6.)

* Tested with the following primitive types: `byte`, `int8`, `int16`, `int32`, `int64`, `uint8`, `uint16`, `uint32`, `uint64`
* Works only if _all_ the given parameters are: `float32` and `float64`

